'The Cold Light of Day' gaat over de jonge Amerikaan Will (Henry Cavill) die tijdens een vakantie in Spanje zijn gezin in handen 
van ontvoerders ziet vallen. Tijdens de zoektocht naar zijn gezin stuit hij op een samenzwering van de overheid en een connectie 
tussen de kidnapping en zijn vader.
